import React from "react";
import Logo from "../components/Logo";
import Navigation from "../components/Navigation";
import GalleryDisplay from "../components/GalleryDisplay";

const Gallery = () => {
  return (
    <main>
      <div className="gallery">
        <Navigation />
        <Logo />
        <GalleryDisplay />
      </div>
    </main>
  );
};

export default Gallery;
